import React, { useState } from "react";
import { RiMenu3Line, RiCloseLine } from 'react-icons/ri';
import logo from '../../assets/logo.png'
import './navbar.css';

const Menu = () => (
    <>
    <p><a href="#home"> Home </a></p>
    <p><a href="#gallery"> Gallery </a></p>
    <p><a href="#page"> Pricing </a></p>
    <p><a href="#contactus"> Contact Us </a></p>
    
    </>
)

// bem -> Block Element Modifier

const Navbar = () => {
    const[toggleMenu, setToggleMenu] = useState(false)
    return (
        <div className ="ccs__navbar">
            <div className ="ccs__navbar-links">
        
            <div className="ccs__navbar-links_container">
                <p><a href="#home"> Home </a></p>
                <p><a href="#home"> Gallery </a></p>
                <p><a href="#home"> Pricing </a></p>
                <p><a href="#footer"> Contact Us </a></p>
                
            </div>
            </div>
            <div className="ccs__navbar-menu">
                {toggleMenu
                 ? <RiCloseLine color="#fff" size={27} onClick={() => setToggleMenu(false)} />
                 : <RiMenu3Line color="#fff" size={27} onClick={() => setToggleMenu(true)} />
                }
                {toggleMenu && (
                    <div className="ccs__navbar-menu_container scale-up-center">
                    <div className="ccs__navbar-menu_container-links">
                        
                    </div>
                    </div>
                    

                )}
            </div>
        </div>
    )
}
export default Navbar;
